import React from 'react';
import { useNavigate } from 'react-router-dom';
import GameCanvas from '../components/game/GameCanvas';
import './GamePage.css'; // nếu bạn muốn tách riêng CSS

function GamePage() {
  const navigate = useNavigate();

  return (
    <div className="relative w-fit mx-auto mt-4">
      {/* Nút quay lại */}
      <button
        onClick={() => navigate('/')}
        className="absolute top-2 left-2 z-10 bg-white bg-opacity-80 hover:bg-opacity-100 text-black px-3 py-1 rounded shadow"
      >
        ← Trang chủ
      </button>

      {/* Canvas game */}
      <GameCanvas />
    </div>
  );
}

export default GamePage;
